def index(request):
    type = request.GET.get('type')
    print(type)

    '''
    0:仅需要一张静态图片 不填就默认是这个
    1:两张静态图片
    2:
    
    '''

    res = {}
    if type == '通用滑块':
        img_data = 'data:image/png;base64,'
        res['img_data'] = img_data
    elif type == '旋转(百度贴吧)':
        img_data = 'data:image/png;base64,'
        res['img_data'] = img_data

    elif type == '面积点选':
        img_data = 'data:image/png;base64,'
        res['img_data'] = img_data

    elif type == '图标点选(顶象)':
        img_data = 'data:image/jpeg;base64,'
        res['img_data'] = img_data
        res['title_data'] = 'data:image/png;base64,'
        res['input'] = 1


    else:
        type = '通用滑块'
        img_data = 'data:image/png;base64,'
        res['img_data'] = img_data

    res['type'] = type

    return render(request, 'index.html',res)


#分流
def classify(types,request):
    if types == '通用滑块':
        start = time.time()*1000

        json_data = slider(request).content
        end = time.time()*1000

        json_data =json.loads(json_data.decode())
        with open('./data/滑块拼图/drow_rectangle.png', 'rb') as f:
            data = f.read()
        img =  base64.b64encode(data).decode()
        json_data['data'] =img
        json_data['consume'] = end-start
        json_data['success'] = True
        return json_data

    elif types == '旋转(百度贴吧)':
        start = time.time()*1000

        json_data = ocr(request).content
        end = time.time()*1000

        json_data =json.loads(json_data.decode())
        with open('./data/旋转角度/drow_rectangle.png', 'rb') as f:
            data = f.read()
        img =  base64.b64encode(data).decode()
        json_data['data'] =img
        json_data['consume'] = end-start
        json_data['success'] = True
        return json_data

    elif types == '面积点选':

        start = time.time()*1000

        json_data = acreages(request).content
        end = time.time()*1000

        json_data =json.loads(json_data.decode())
        with open('./data/面积点选/drow_rectangle.png', 'rb') as f:
            data = f.read()
        img =  base64.b64encode(data).decode()
        json_data['data'] =img
        json_data['consume'] = end-start
        json_data['success'] = True
        return json_data
    elif types == '图标点选(顶象)':


        dicts = {}
        dicts['img1'] =  request.POST.get('img')
        dicts['img2'] = [request.POST.get('title')]
        # #修改状态
        # data = request.POST
        # _mutable = data._mutable
        # data._mutable = True
        #
        request._body  = str(json.dumps(dicts)).encode()
        # #恢复状态
        # data._mutable = _mutable


        start = time.time()*1000

        json_data = click_on_the_icon(request).content
        end = time.time()*1000

        json_data =json.loads(json_data.decode())
        with open('./data/图标点选/drow_rectangle.png', 'rb') as f:
            data = f.read()
        img =  base64.b64encode(data).decode()
        json_data['data'] =img
        json_data['consume'] = end-start
        json_data['success'] = True
        return json_data


    else:
        return {'1':'2'}


def test(request):
    if request.method == "POST":
        #修改状态
        data = request.POST
        _mutable = data._mutable
        data._mutable = True

        img_data = data['img']
        img_data = img_data.split(',')[-1]
        img_data = base64.urlsafe_b64decode(img_data)
        img_data = base64.b64encode(img_data).decode()
        data['img'] = img_data
        if data.get('title'):
            img_data = data['title']
            img_data = img_data.split(',')[-1]
            img_data = base64.urlsafe_b64decode(img_data)
            img_data = base64.b64encode(img_data).decode()
            data['title'] = img_data

        #恢复状态
        data._mutable = _mutable



        #分流
        json_data =classify(data['project_name'] ,request)



        print(json_data)
        return HttpResponse(json.dumps(json_data), content_type="application/json")

    else:

        resp = {'errorcode': 100,
                'detail': '恭喜你发现了这个彩蛋！！!这是你的奖励： https://music.163.com/song?id=1501530173&userid=1387563087'}
        return HttpResponse(json.dumps(resp), content_type="application/json")
